import React, { Component, Fragment } from 'react';

class TodoList extends Component {
  render() {
    return (
      <div>
        <div>
          <input />
          <button>Submit</button>
        </div>
        <ul>
          <li> Learning English </li>
          <li> Learning coding</li>
        </ul>
      </div>
    );
  }
}


export default TodoList;
// export default把该组件导出
